import { Box, Grid, Typography } from "@mui/material";
import React from "react";
import Chart from "react-apexcharts";
import {
  LEFT_SIDE_CHART_SERIES,
  LEFT_SIDE_CHART_OPTIONS,
  RIGHT_SIDE_CHART_SERIES,
  RIGHT_SIDE_CHART_OPTIONS,
} from "./constants";

const BarChart = () => {
  return (  
    <Grid container>
      <Grid item xs={12}>
        <Box sx={{display:"flex"}}>
          <Box sx={{width:"10px", height:"10px", background:"red"}}></Box>
          <Typography>
              Digital
          </Typography>
        </Box>
      </Grid>
    <Grid  item xs={12} sx={{ display: "flex", width: "100%" }}>

      <Box sx={{ width: "50%" }}>
        <Chart
          options={LEFT_SIDE_CHART_OPTIONS}
          series={LEFT_SIDE_CHART_SERIES}
          type="bar"
          height={400}
        />
      </Box>
      <Box sx={{ width: "50%" }}>
        <Chart
          options={RIGHT_SIDE_CHART_OPTIONS}
          series={RIGHT_SIDE_CHART_SERIES}
          type="bar"
          height={400}
        />
      </Box>
    </Grid>
    </Grid>
  );
};

export default BarChart;
